text:
{'text': "Dropped by Collins at Westgate for a quick dessert and coffee break. I ordered the Dirty Honey Latte, which the menu clearly stated would be served cold ‚Äì but it came hot without any explanation or option. That was disappointing, especially on a warm day when I was expecting something refreshing.

The tiramisu was available, so I gave it a try. Presentation was nice, but it turned out to be overly sweet and lacked the rich, balanced flavors you'd expect from a good tiramisu. Both the coffee and dessert leaned too heavily on sugar, which overshadowed the finer details.

While Collins isn‚Äôt particularly known for its coffee or desserts, I had hoped for a more polished experience. Service and ambiance were fine, but the offerings didn‚Äôt quite meet expectations. A solid 3 out of 5.", 'languageCode': 'en'}

