text:
{'text': "Mushroom soup was creamy and did not taste like it's from a can. Bread was fresh and crispy.

Tempura squid was freshly fried, though could have had more batter. Also slightly oily and could have been more thoroughly drained. Nicely seasoned.

Steak was cooked and seasoned well, but was smaller than expected. Bone seemed deep fried and was tasty. However, not very worth the price point at 108$ for the steak.", 'languageCode': 'en'}

