{'text': 'I‚Äôve always enjoyed coming to this restaurant whenever I‚Äôm in the area, and it‚Äôs usually been a pleasant experience. However, my recent visit on Sunday fell short of expectations. We waited about 30 minutes for our food, and it was only after we checked in with the staff that the chef began preparing our order. The restaurant wasn‚Äôt crowded, so it was a little surprising that no one followed up earlier.

There were also quite a number of flies inside, which made the dining environment a bit uncomfortable :( I got the Collins mixed grill but unfortunately, the chicken skin was quite burnt, and it left an off putting and burnt taste.

Hope this gets looked into. Thank you!', 'languageCode': 'en'}

